import React from "react";

const Roadmap = () => {
  return (
    <div>
      <div className="text-red-700 font-semibold text-center text-4xl pb-10">
        ROADMAP
      </div>
      <video
        autoPlay
        className="w-[100%] px-10 xl:"
        src="https://weabove.io/roadmap_hd.mp4"
      ></video>
    </div>
  );
};

export default Roadmap;
